//Calculator function that returns an object with methods and variables
export default function calc (){

  return {
    result: 0,

    addition: function(value){
      this.result+=(Number.parseFloat(value));
    },

    substraction: function(value){
      this.result+=(Number.parseFloat(value));
    }
  };

};
